import React from 'react'
import './clusterMessage.component.scss'
import Button from '../button/button.component'
import {useTrail, animated} from 'react-spring'

export default function ClusterMessage() {
    const [trail, set, stop] = useTrail(3, () => ({opacity: 1}))

// Update trail
set({opacity: 0})
// Stop trail
stop()
    return (
        <div className="cluster-message">
            <h1>materiale de contructii, gradinarit & bricolaj</h1>
            <animated.div style={trail}>
            <p>Nu ai gasit ce cautai?</p>
            <p>Preluam si comenzi speciale</p>
            <p>Apeleaza-ne la 0732 409 095</p>
            </animated.div>
            <Button/>
        </div>
    )
}
